import styled from "styled-components";

export const Section = styled.section``;

export const Container = styled.div`
  h3 {
    color: #b9060d;
  }
  p {
    font-size: 0.8rem;
  }
  img {
    display: none;
    @media screen and (max-width: 480px) {
      display: block;
      width: 100%;
      border-radius: 1rem;
      margin: 2rem 0rem;
    }
  }
`;
